import React, { useState, useEffect } from 'react';
import {
  Box,
  Button,
  Typography,
  TextField,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  MenuItem,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Alert,
} from '@mui/material';
import { format } from 'date-fns';
import axios from 'axios';

function TimeEntries() {
  const [timeEntries, setTimeEntries] = useState([]);
  const [projects, setProjects] = useState([]);
  const [users, setUsers] = useState([]);
  const [open, setOpen] = useState(false);
  const [error, setError] = useState(null);
  const [newEntry, setNewEntry] = useState({
    project_id: '',
    user_id: '',
    start_time: '',
    end_time: '',
    description: '',
  });

  useEffect(() => {
    fetchTimeEntries();
    fetchProjects();
    fetchUsers();
  }, []);

  const fetchTimeEntries = async () => {
    try {
      const response = await axios.get('http://localhost:3002/api/time-entries');
      console.log('Fetched time entries:', response.data);
      setTimeEntries(response.data);
    } catch (error) {
      console.error('Error fetching time entries:', error);
      setError('Failed to fetch time entries. Please try again.');
    }
  };

  const fetchProjects = async () => {
    try {
      const response = await axios.get('http://localhost:3002/api/projects');
      console.log('Fetched projects:', response.data);
      setProjects(response.data);
    } catch (error) {
      console.error('Error fetching projects:', error);
      setError('Failed to fetch projects. Please try again.');
    }
  };

  const fetchUsers = async () => {
    try {
      const response = await axios.get('http://localhost:3002/api/users');
      console.log('Fetched users:', response.data);
      setUsers(response.data);
    } catch (error) {
      console.error('Error fetching users:', error);
      setError('Failed to fetch users. Please try again.');
    }
  };

  const handleOpen = () => {
    setError(null);
    setOpen(true);
  };

  const handleClose = () => {
    setError(null);
    setOpen(false);
  };

  const handleSubmit = async () => {
    try {
      if (!newEntry.project_id) {
        setError('Please select a project');
        return;
      }

      if (!newEntry.user_id) {
        setError('Please select a user');
        return;
      }

      if (!newEntry.start_time) {
        setError('Start time is required');
        return;
      }

      if (!newEntry.end_time) {
        setError('End time is required');
        return;
      }

      console.log('Submitting new time entry:', newEntry);
      const response = await axios.post('http://localhost:3002/api/time-entries', newEntry);
      console.log('Time entry created:', response.data);

      fetchTimeEntries();
      handleClose();
      setNewEntry({
        project_id: '',
        user_id: '',
        start_time: '',
        end_time: '',
        description: '',
      });
    } catch (error) {
      console.error('Error creating time entry:', error);
      setError(error.response?.data?.error || 'Failed to create time entry. Please try again.');
    }
  };

  const calculateDuration = (startTime, endTime) => {
    const start = new Date(startTime);
    const end = new Date(endTime);
    const diffInMilliseconds = end - start;
    const hours = Math.floor(diffInMilliseconds / (1000 * 60 * 60));
    const minutes = Math.floor((diffInMilliseconds % (1000 * 60 * 60)) / (1000 * 60));
    return `${hours}h ${minutes}m`;
  };

  return (
    <Box>
      <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 3 }}>
        <Typography variant="h4">Time Entries</Typography>
        <Button variant="contained" color="primary" onClick={handleOpen}>
          Add Time Entry
        </Button>
      </Box>

      {error && (
        <Alert severity="error" sx={{ mb: 2 }}>
          {error}
        </Alert>
      )}

      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Project</TableCell>
              <TableCell>User</TableCell>
              <TableCell>Start Time</TableCell>
              <TableCell>End Time</TableCell>
              <TableCell>Duration</TableCell>
              <TableCell>Description</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {timeEntries.map((entry) => (
              <TableRow key={entry.id}>
                <TableCell>{entry.project_name}</TableCell>
                <TableCell>{entry.user_name}</TableCell>
                <TableCell>
                  {format(new Date(entry.start_time), 'PPpp')}
                </TableCell>
                <TableCell>
                  {format(new Date(entry.end_time), 'PPpp')}
                </TableCell>
                <TableCell>
                  {calculateDuration(entry.start_time, entry.end_time)}
                </TableCell>
                <TableCell>{entry.description}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>

      <Dialog open={open} onClose={handleClose}>
        <DialogTitle>Add Time Entry</DialogTitle>
        <DialogContent>
          <TextField
            select
            fullWidth
            margin="dense"
            label="Project"
            value={newEntry.project_id}
            onChange={(e) => setNewEntry({ ...newEntry, project_id: e.target.value })}
            error={!!error && !newEntry.project_id}
            helperText={!newEntry.project_id ? 'Please select a project' : ''}
          >
            {projects.map((project) => (
              <MenuItem key={project.id} value={project.id}>
                {project.name}
              </MenuItem>
            ))}
          </TextField>
          <TextField
            select
            fullWidth
            margin="dense"
            label="User"
            value={newEntry.user_id}
            onChange={(e) => setNewEntry({ ...newEntry, user_id: e.target.value })}
            error={!!error && !newEntry.user_id}
            helperText={!newEntry.user_id ? 'Please select a user' : ''}
          >
            {users.map((user) => (
              <MenuItem key={user.id} value={user.id}>
                {user.name}
              </MenuItem>
            ))}
          </TextField>
          <TextField
            fullWidth
            margin="dense"
            label="Start Time"
            type="datetime-local"
            value={newEntry.start_time}
            onChange={(e) => setNewEntry({ ...newEntry, start_time: e.target.value })}
            InputLabelProps={{
              shrink: true,
            }}
            error={!!error && !newEntry.start_time}
            helperText={!newEntry.start_time ? 'Start time is required' : ''}
          />
          <TextField
            fullWidth
            margin="dense"
            label="End Time"
            type="datetime-local"
            value={newEntry.end_time}
            onChange={(e) => setNewEntry({ ...newEntry, end_time: e.target.value })}
            InputLabelProps={{
              shrink: true,
            }}
            error={!!error && !newEntry.end_time}
            helperText={!newEntry.end_time ? 'End time is required' : ''}
          />
          <TextField
            fullWidth
            margin="dense"
            label="Description"
            multiline
            rows={4}
            value={newEntry.description}
            onChange={(e) => setNewEntry({ ...newEntry, description: e.target.value })}
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose}>Cancel</Button>
          <Button onClick={handleSubmit} variant="contained" color="primary">
            Add Entry
          </Button>
        </DialogActions>
      </Dialog>
    </Box>
  );
}

export default TimeEntries;
